import React from "react";
import image1 from "../Images/salameche.png";

export default function Card() {
  return (
    <div className="card">
      <h2>1</h2>
      <img className="h-10 w-20 " src={image1} alt="" />
      <h3>3</h3>
    </div>
  );
}
